import React from 'react'

const ProductListItem = ({product}) => {
  return (
    <div>
        <div>id: {product.id}</div>
        <h3>{product.name}</h3>
        <div>{product.price}</div>
        <img src={'http://127.0.0.1:8000/'+product.image}/>
    </div>
  )
}

export default ProductListItem
